import React, { Component } from 'react'



class Index extends Component {
  render() {
    return (
      <h1 style = {style.styleTitulo}>
        holis
      </h1>
    )
  }
}

style = {
  styleTitulo: {
    color: 'black'
  }
}

export default Index
